// Florida Quiz Lesson
// This lesson demonstrates a simple quiz about Florida

class FloridaQuiz {
  private questions: Array<{question: string, answer: string}> = [
    { question: "What is the capital of Florida?", answer: "Tallahassee" },
    { question: "What is the largest city in Florida?", answer: "Jacksonville" },
    { question: "What is the nickname of Florida?", answer: "The Sunshine State" }
  ];

  // Run the quiz
  public runQuiz(): void {
    console.log("Welcome to the Florida Quiz!");

    let score = 0;

    for (const [index, q] of this.questions.entries()) {
      const userAnswer = prompt(`${index + 1}. ${q.question}`);

      if (userAnswer && userAnswer.toLowerCase() === q.answer.toLowerCase()) {
        console.log("Correct!");
        score++;
      } else {
        console.log(`Wrong! The correct answer is: ${q.answer}`);
      }
    }

    console.log(`Quiz finished! Your score: ${score}/${this.questions.length}`);
  }
}

// Example usage
const quiz = new FloridaQuiz();
// quiz.runQuiz(); // Uncomment to run the quiz

